import React, { Component } from 'react'

export default class Movies extends Component {
  render() {
    return(
      <Card.Group itemsPerRow={7}>
         {this.props.landingMovies.map((movie) => 
      <MovieCard 
         key={movie.id}
         movieId={movie.id}
         img={movie['poster_240x342']} />)}
      </Card.Group>
    )
  }
}
